import axios from "axios"
import { API_URL } from "../../configapi"
import { useState } from "react"

const Test = () => {
    const [data, setData] = useState([])
    axios.get(API_URL)
        .then(res => {
            setData(res.data)
        })
        .catch(err => {
            console.log(err);
        })
    return (
        <div className="">
            <h1>Test Làm Bài Kiểm Tra</h1>
            {
                data.map((list) => {
                    return (
                        <div class="form-check">
                            <label class="form-check-label">{list.cauhoi}
                                <input type="radio" class="form-check-input" name={list.cauhoi} value={list.kq}/>{list.c1}
                                <input type="radio" class="form-check-input" name={list.cauhoi} value={list.kq}/>{list.c2}
                                <input type="radio" class="form-check-input" name={list.cauhoi} value={list.kq}/>{list.c3}
                                <input type="radio" class="form-check-input" name={list.cauhoi} value={list.kq}/>{list.c4}
                            </label>
                        </div>
                    )
                })
            }
        </div>
    )
}
export default Test
